import React from 'react';
import HomeOutlinedIcon from '@material-ui/icons/HomeOutlined';
import ForumOutlinedIcon from '@material-ui/icons/ForumOutlined';
import AlternateEmailIcon from '@material-ui/icons/AlternateEmail';
import SearchIcon from '@material-ui/icons/Search';
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import './Home.css';

/**
* Simple component with no state.
*
* @return {object} JSX
*/
function Home() {
  return (
    <div id='navigation'>
      <span className='nav-icons'>
        <HomeOutlinedIcon className='icon' fontSize='large'/>
      </span>
      <span className='nav-icons'>
        <ForumOutlinedIcon className='icon' fontSize='large'/>
      </span>
      <span className='nav-icons'>
        <AlternateEmailIcon className='icon' fontSize='large'/>
      </span>
      <span className='nav-icons'>

        <SearchIcon className='icon' fontSize='large'/>
      </span>
      <span className='nav-icons'>
        <PermIdentityIcon className='icon' fontSize='large'/>
      </span>
    </div>
  );
}

export default Home;
